-- ----------------------------
-- View structure for `vlingx_wf_task_expire`
-- ----------------------------
DROP VIEW IF EXISTS `vlingx_wf_task_expire`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vlingx_wf_task_expire` AS select `t`.`id` AS `id`,`t`.`name` AS `name`,`t`.`instance_id` AS `instance_id`,`t`.`task_id` AS `task_id`,`t`.`user_id` AS `user_id`,`t`.`status` AS `status`,`t`.`stime` AS `stime`,`t`.`etime` AS `etime`,`t`.`create_time` AS `create_time`,`t`.`modify_time` AS `modify_time`,`a`.`expire` AS `expire`,`b`.`name` AS `instance_name`,`b`.`user_id` AS `instance_user_id` from ((`tlingx_wf_instance_task` `t` join `tlingx_wf_define_task` `a`) join `tlingx_wf_instance` `b`) where ((`t`.`task_id` = `a`.`id`) and (`t`.`instance_id` = `b`.`id`) and (`a`.`expire` <> 0) and (`t`.`stime` < date_format((now() - interval `a`.`expire` hour),'%Y%m%d%H%i%S'))) ;

-- ----------------------------
-- Function structure for `currval`
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS int(11)
    DETERMINISTIC
BEGIN  
         DECLARE value INTEGER;  
         SET value = 0;  
         SELECT current_value INTO value  
                   FROM tlingx_sequence  
                   WHERE name = seq_name;  
         RETURN value;  
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `nextval`
-- ----------------------------
DROP FUNCTION IF EXISTS `nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `nextval`(seq_name VARCHAR(50)) RETURNS int(11)
    DETERMINISTIC
BEGIN  
         UPDATE tlingx_sequence  
                   SET current_value = current_value + increment  
                   WHERE name = seq_name;  
         RETURN currval(seq_name);  
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `setval`
-- ----------------------------
DROP FUNCTION IF EXISTS `setval`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `setval`(seq_name VARCHAR(50), value INTEGER) RETURNS int(11)
    DETERMINISTIC
BEGIN  
         UPDATE tlingx_sequence  
                   SET current_value = value  
                   WHERE name = seq_name;  
         RETURN currval(seq_name);  
END
;;
DELIMITER ;
